/**
 * Add data-* attribute to a HTML string
 *
 * @access private
 *
 * @param {String} string - HTML string
 * @param {String} name - attribute name
 * @param {String} value - attribute value
 *
 * @return {String} HTML string with attribute
 */
export function getAttributedEntry(string: string, name: string, value: string): string;
/**
 * Add CSL identifiers to entry
 *
 * @access private
 *
 * @param {String} value - HTML string
 * @param {String} id - ID
 *
 * @return {String} HTML string with CSL ID
 */
export function getPrefixedEntry(value: string, id: string): string;
